import React from "react";
import Button from "../../components/Global/Button/Button";
import { useFetch } from "../../hooks/useFetch";
import Loading from "../../components/Global/Loading/Loading";

const Catalogus = () => {
  const {
    isLoading,
    error,
    invalidate,
    data: catalogus,
  } = useFetch("/products");

  if (error) {
    return <p>{error}</p>;
  }

  if (isLoading) {
    return <Loading />;
  }

  return (
    <div>
      {/* Your catalogus content goes here */}
      <h2>Catalogus</h2>
      {/* Add your catalogus items */}
      <div className="producten">
        {catalogus.map((product) => (
          <div className="productCard" key={product._id}>
            <ProductCard product={product} />
          </div>
        ))}
      </div>

      <div className="catalogus-item">
        <h3>Titel</h3>
        <p>Beschrijving</p>
        <img src="" alt="Foto" />
        <p>Categorie</p>
